pragma solidity ^0.4.24;

import "./Device.sol";

contract DeviceSpawner {
    address private rawbot_address;

    mapping(uint256 => address) private devices;
    mapping(uint256 => address) private merchants;
    mapping(address => bool) private devices_access;

    uint256 private total_devices = 0;
    uint256 private total_merchants = 0;

    mapping(address => Merchant) private merchant;
    mapping(address => DeviceInfo) private infoOf;
    mapping(address => uint256) private total_devices_of;


    struct Merchant {
        mapping(uint256 => address) devices;
        bool available;
    }

    event DeviceAdd(
        address _rawbot_address,
        address _sender,
        address _contract
    );

    struct DeviceInfo {
        bytes32 serial_number;
        bytes32 name;
        address owner;
        bytes32 owner_name;
        address manager;
        bytes32 country;
        bytes32 location;
        uint256 latitude;
        uint256 longitude;
        uint256 altitude;
        uint256 accuracy;
        bool available;
    }

    constructor(address _input_address) public payable {
        rawbot_address = _input_address;
    }

    function getRawbotAddress() public view returns (address _rawbot_address){
        return rawbot_address;
    }

    function addDevice(
        address _manager,
        bytes32 _device_serial_number,
        bytes32 _device_name,
        bytes32 _owner_name,
        bytes32 _country,
        bytes32 _location,
        uint256 _latitude,
        uint256 _longitude,
        uint256 _altitude,
        uint256 _accuracy
    ) public returns (Device __spawned_device) {
        Device device = new Device(msg.sender, rawbot_address);
        infoOf[device] = DeviceInfo(
            _device_serial_number,
            _device_name,
            msg.sender,
            _owner_name,
            _manager,
            _country,
            _location,
            _latitude,
            _longitude,
            _altitude,
            _accuracy,
            true
        );

        if (merchant[msg.sender].available == false) {
            merchants[total_merchants] = msg.sender;
            merchant[msg.sender].available = true;
            total_merchants++;
        }

        uint256 total_user_devices = total_devices_of[msg.sender];
        merchant[msg.sender].devices[total_user_devices] = device;
        devices[total_devices] = device;

        total_devices++;
        total_devices_of[msg.sender]++;
        emit DeviceAdd(rawbot_address, msg.sender, device);
        return device;
    }

    function getTotalDevices() public view returns (uint256 __total_devices) {
        return total_devices;
    }

    function getTotalMerchants() public view returns (uint256 __total_merchants){
        return total_merchants;
    }

    function getTotalDevicesOf(address _address) public view returns (uint256 __total_devices_of){
        return total_devices_of[_address];
    }

    function getDevice(uint256 _device_index) public view returns (address __device_address){
        return devices[_device_index];
    }

    function getDeviceAddressOf(address _merchant_address, uint256 _device_index) public view returns (address __device_address){
        return merchant[_merchant_address].devices[_device_index];
    }

    function hasAccess(address _address) external view returns (bool __allowed){
        return infoOf[_address].available;
    }

    /**
        Device information
    **/

    function getContractBalance() public view returns (uint256 __balance){
        return address(this).balance;
    }

    function getDeviceOwner(address device_address) public view returns (address __device_owner) {
        return infoOf[device_address].owner;
    }

    function getDeviceManager(address device_address) public view returns (address __device_manager) {
        return infoOf[device_address].manager;
    }

    function getDeviceBalance(address device_address) public view returns (uint256 __device_balance){
        return address(device_address).balance;
    }

    function setDeviceManager(address device_address, address device_manager) public returns (bool success){
        require(getDeviceOwner(device_address) == msg.sender, "Msg sender isn't the owner.");
        infoOf[device_address].manager = device_manager;
        return true;
    }

    function getDeviceInformation(address device_address)
    public view
    returns (
        bytes32 serial_number,
        bytes32 name,
        address owner,
        bytes32 owner_name,
        bytes32 country,
        bytes32 location,
        uint256 latitude,
        uint256 longitude,
        uint256 altitude,
        uint256 accuracy
    )
    {
        DeviceInfo info = infoOf[device_address];
        return (
        info.serial_number,
        info.name,
        info.owner,
        info.owner_name,
        info.country,
        info.location,
        info.latitude,
        info.longitude,
        info.altitude,
        info.accuracy
        );
    }
}
